import logo from './logo.svg';
import './App.css';
import React, {Component} from 'react'

class App extends Component {
  constructor(){
    super();

    this.state = {
      string: 'Hello from react'
    }
  }
  render(){
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            {this.state.state}
        </p>
        <button onClick={() => this.s}>Change text</button>
        </header>
      </div>
    );
  }

}

export default App;
